import React from 'react';
import { 
    ModalPage,
    ModalPageHeader,
    Header,
    Div,

  } from '@vkontakte/vkui';

import { Anchorme } from 'react-anchorme'

import Icon24Dismiss              from '@vkontakte/icons/dist/24/dismiss';


export default class Donut extends React.Component {
    render() {
        return (
            <ModalPage
                id={this.props.id}
                onClose={this.props.onClose}
                header={
                  <ModalPageHeader
                  right={platform === ANDROID && <Header onClick={this.modalBack}><Icon24Dismiss /></Header>}
                  left={platform === IOS && <PanelHeaderButton onClick={this.props.onClose}><Icon24Dismiss /></PanelHeaderButton>}
                  right={<Header onClick={this.props.onClose}><Icon24Dismiss /></Header>}
                  >
                    Комментарий
                  </ModalPageHeader>
                }
                >
                  <Div>
                    <div style={{whiteSpace: "pre-wrap"}}><Anchorme target="_blank" rel="noreferrer noopener">{this.props.comment}</Anchorme></div>
                  </Div>
            </ModalPage>
        )
    }
}
